import { Type, And, Or } from './lib/Type'
import { BitDepth } from './util/constants'
import { Description, ObjectOf, Static, TypeGuard } from './util/generics'
import { joinDescription } from './util/joinDecription'
import { wrapPropertyKey } from './util/wrapPropertyKey'

export { Static } from './util/generics'

export const is = <T>(
  description: Description,
  check: TypeGuard<T>,
): Type<T> => {
  return new Type(description, check)
}

export const and = <T extends Type<any>>(...types: Array<T>): T => {
  return new And(types) as T
}

export const or = <T extends Array<Type<any>>>(
  ...types: T
): Type<Static<T[number]>> => {
  return new Or(types)
}

export const literal = <T extends string | number | boolean | null | undefined>(
  literalValue: T,
): Type<T> => {
  return is(
    `equal to ${String(literalValue)}`,
    (value: any): value is T => value === literalValue,
  )
}

export const either = <T extends string | number | boolean | null | undefined>(
  ...literalValues: Array<T>
): Type<T> => {
  return or(...literalValues.map(literal))
}

export const optional = <T>(type: Type<T>): Type<T | undefined> => {
  return or(type, isUndefined)
}

export const nullable = <T>(type: Type<T>): Type<T | null> => {
  return or(type, isNull)
}

export const range = (min: number, max: number): Type<number> => {
  return and(
    isNumber,
    is(
      `from ${min} to ${max}`,
      (value: any): value is number => value >= min && value <= max,
    ),
  )
}

export const at = <K extends PropertyKey, T>(
  key: K,
  type: Type<T>,
): Type<ObjectOf<K, T>> => {
  if (isNumber.check(key)) {
    return is(
      `${isArray.description} where ${wrapPropertyKey(key)} is ${
        type.description
      }`,
      (value: any): value is ObjectOf<K, T> =>
        Array.isArray(value) && type.check(value[key]),
    )
  }
  return is(
    `${isObject.description} where ${wrapPropertyKey(key)} is ${
      type.description
    }`,
    (value: any): value is ObjectOf<K, T> =>
      value != null && type.check(value[key]),
  )
}

export const matches = (
  description: string,
  expression: RegExp,
): Type<string> => {
  return and(
    isString,
    is(
      `a match to ${description}`,
      (value: any): value is string => (
        (expression.lastIndex = 0), expression.test(value)
      ),
    ),
  )
}

export const array = <T>(type: Type<T>): Type<Array<T>> => {
  return is(
    `${isArray.description} where every element is ${type.description}`,
    (value: any): value is Array<T> =>
      Array.isArray(value) && value.every(type.check),
  )
}

export const object = <T>(type: Type<T>): Type<Record<any, T>> => {
  return is(
    `${isObject.description} where every value is ${type.description}`,
    (value: any): value is Record<any, T> =>
      value != null && Object.values(value).every(type.check),
  )
}

export const record = <T extends Record<string, Type<any>>>(
  rules: T,
): Type<{ [K in keyof T]: Static<T[K]> }> => {
  const keys = Object.keys(rules)
  return Object.assign(
    and(isObject, ...(keys.map((key) => at(key, rules[key])) as any)),
    {
      description: `${isObject.description} where ${joinDescription(
        keys.map(
          (key) => `${wrapPropertyKey(key)} is ${rules[key].description}`,
        ),
        'and',
      )}`,
    },
  )
}

export const tuple = <T extends Array<any>>(
  ...types: { [K in keyof T]: Type<T[K]> }
): Type<{ [K in keyof T]: T[K] }> => {
  return Object.assign(
    and(
      isArray as Type<Array<unknown>>,
      ...(types.map((type, index) => at(index, type)) as any),
    ),
    {
      description: `${isArray.description} where ${joinDescription(
        types.map(
          (type, index) => `${wrapPropertyKey(index)} is ${type.description}`,
        ),
        'and',
      )}`,
    },
  )
}

export const isNull = literal(null)
export const isUndefined = literal(undefined)
export const isNothing = or(isNull, isUndefined)
export const isAny = is('any', (value: any): value is any => true || value)
export const isUnknown = is(
  'unknown',
  (value: any): value is unknown => true || value,
)

export const isNever = is(
  'never',
  (value: any): value is never => false && value,
)

export const isBoolean = is(
  `a boolean`,
  (value: any): value is boolean => typeof value === 'boolean',
)

export const isNumber = is(
  `a number`,
  (value: any): value is number => typeof value === 'number' && value === value,
)

export const isString = is(
  `a string`,
  (value: any): value is string => typeof value === 'string',
)

export const isSymbol = is(
  `a symbol`,
  (value: any): value is symbol => typeof value === 'symbol',
)

export const isArray = is('an Array', Array.isArray)
export const isObject = is(
  `an object`,
  (value: any): value is object => value != null && typeof value === 'object',
)

export const isTrue = literal(true)
export const isFalse = literal(false)

export const isFunction = is(
  `a function`,
  (value: any): value is Function => typeof value === 'function',
)

export const isDictionary = object(isString)
export const isEnumerable = object(isNumber)

export const isInt = and(
  isNumber,
  is(
    'an integer',
    (value: any): value is number =>
      Math.floor(value) === value && value !== Infinity,
  ),
)

export const isInt8 = and(
  isInt,
  range(0 - BitDepth['8'] / 2, BitDepth['8'] / 2 - 1),
)

export const isInt16 = and(
  isInt,
  range(0 - BitDepth['16'] / 2, BitDepth['16'] / 2 - 1),
)

export const isInt32 = and(
  isInt,
  range(0 - BitDepth['32'] / 2, BitDepth['32'] / 2 - 1),
)

export const isUint = and(
  isNumber,
  is(
    'a positive integer',
    (value: any): value is number =>
      Math.floor(value) === value && value >= 0 && value !== Infinity,
  ),
)

export const isUint8 = and(isUint, range(0, BitDepth['8'] - 1))
export const isUint16 = and(isUint, range(0, BitDepth['16'] - 1))
export const isUint32 = and(isUint, range(0, BitDepth['32'] - 1))

export const isLength = isUint32
export const isBitFlag = isUint32

export const isPoint = tuple(isNumber, isNumber)
export const isPosition = tuple(isUint8, isNumber, isNumber)
